import './App.css';
import {
  BrowserRouter as Router,
  Routes,
  Route,

} from "react-router-dom";
import Navbar from './components/Navbar';
import About from './components/About';
import Home from './components/Home';

function App() {
  return (
    <div>

      <Router>


      <Routes>
          <Route exact path="/about">
           <Navbar/>
          </Route>
          <Route exact path="/users">
           <About/>
          </Route>
          <Route exact path="/">
            <Home />
          </Route>
        </Routes>


      </Router>
    </div>
  );
}

export default App;
